setTimeout(function() {

	function showmusic() {
	
	document.getElementById('navbar').style.display = 'none';
	document.getElementById('content').style.display = 'none';

	*{padding:0;margin:0;}
	html{margin:0; padding:0; height:100%; width:100%; }
	body{height: 100%;
    overflow: scroll;max-width:100%;max-height:100%;color:#fff;background: #464646;}
	.navbar{    box-shadow: 0 1px 4px 0 rgba(0, 0, 0, 0.25); height:60px;width:100%;position:relative;background:#323232;}
	.navbar p{padding-top:19px;font-size:18px;}
	.navbar a{padding-left:14px;color:#19A;text-decoration:none;}
	.content{        position:relative;padding-top:19px;}
	.content a{color:#19A;}
	input:focus,select:focus,option:focus{
	background:#fff;
	 box-shadow: 0 1px 4px 0 rgba(10, 143, 213, 0.7);
	}
	input:active,select:active,option:active{
	background:#fff;
	box-shadow: 0 1px 4px 0 rgba(10, 143, 213, 0.7);
	}
	input:hover,select:hover,option:hover{
	background:#fff;
box-shadow: 0 1px 4px 0 rgba(10, 143, 213, 0.7);
	}
	input,select,option{
	
	outline:0;
	width:100%;
	border:0;
	display: block;
    width: 100%;
    height: 34px;
    padding: 4px 12px;
    font-size: 14px;
    line-height: 1.42857143;
    color: #555;
    background-color: rgba(255,255,255, 0.9);
    background-image: none;
    /* border: 2px solid rgba(10, 143, 213, 0.7); */
    border-radius: 0px;
    -webkit-box-shadow: inset 0 1px 1px rgba(0,0,0,.075);
    box-shadow: inset 0 1px 1px rgba(0,0,0,.075);
    -webkit-transition: border-color ease-in-out .15s,-webkit-box-shadow ease-in-out .15s;
    transition: border-color ease-in-out .15s,box-shadow ease-in-out .15s;
	}
	button{
	 color: #ffffff;
  background-color: #5cb85c;
  border-color: transparent;
	width:214px;
outline:0;
  -webkit-box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075);
  box-shadow: inset 0 1px 1px rgba(0, 0, 0, 0.075);
	padding-left:6px;padding-right:6px;padding-top:6px;padding-bottom:6px;
	}
	button:hover,button:focus,button:active{
	rgba(10, 143, 213, 0.7);
	 color: #ffffff;
  background-color: #449d44;
  border-color: rgba(0, 0, 0, 0);
	}
